function preload(){
    img = loadImage("data:image/jpeg;base64,");
}

function setup(){
    canvas= createCanvas(640,480);
    canvas.position(110,250);
    video= createCapture(VIDEO);
    video.hide();
}

function draw(){
    image(video,230,50,220,200);

    fill(0,128,128);
    stroke(0,128,128);
    circle(130,290,50);

 fill(0,128,128);
    stroke(0,128,128);
    circle(130,30,50);

    fill(0,128,128);
    stroke(0,128,128);
    circle(530,290,50);

    fill(0,128,128);
    stroke(0,128,128);
    circle(530,30,50);

    fill(34,139,34);
    stroke(34,139,34);
    rect(130,290,380,10);

    fill(34,139,34);
    stroke(34,139,34);
    rect(130,30,380,10);

    fill(34,139,34);
    stroke(34,139,34);
    rect(130,30,10,260);

    fill(34,139,34);
    stroke(34,139,34);
    rect(530,30,10,260);
}

